import { useState } from 'react';
import {Panel,Header,Scroller} from '@enact/sandstone/Panels';
import Todo from '../components/Detail/Todo';
import TodoInsert from '../components/Detail/TodoInsert';


const Detail= ()=>{

    return(
        <Panel >
            <Header title="Detail">
            </Header>
            <Scroller>
            <Todo>
               <TodoInsert />
            </Todo>
            </Scroller>
        </Panel>
    )


}

export default Detail;
